import React, { Component } from 'react';
import {Routes, Route, useNavigate} from 'react-router-dom';

import Flower_Match from './spring/Flower-Match';
import history from '.history';

export default class Home extends Component(){
    render(){
        return(
            <div>
                <h1>Hi! Home page</h1>
                <button onClick = {navigateToSpring}>Go to spring</button>

                <Routes>
                    <Route path = './spring/Flower-Match.js' element = {<Flower_Match/>}/>
                </Routes>
            </div>
        )
    }
}
